SELECT LINEITEM.L_QUANTITY, NATION.N_NATIONKEY, REGION.R_REGIONKEY, SUPPLIER.S_NATIONKEY, PARTSUPP.PS_PARTKEY FROM REGION JOIN NATION ON NATION.N_REGIONKEY=REGION.R_REGIONKEY JOIN SUPPLIER ON SUPPLIER.S_NATIONKEY=NATION.N_NATIONKEY JOIN PARTSUPP ON PARTSUPP.PS_SUPPKEY=SUPPLIER.S_SUPPKEY JOIN LINEITEM ON LINEITEM.L_SUPPKEY=PARTSUPP.PS_SUPPKEY WHERE REGION.R_REGIONKEY >= 18350 AND REGION.R_REGIONKEY != R;
